from typing import List


class Solution:
    def increasingTriplet(self, nums: List[int]) -> bool:
        i = 0
        cleaned = []
        while i < len(nums):
            if nums[i] != nums[i-1]:
                cleaned.append(nums[i])
            i += 1
        nums = cleaned

        largeNumbers = []
        largest = nums[-1]
        for i in range(len(nums)-1, -1, -1):
            if nums[i] > largest:
                largest = nums[i]
            largeNumbers.insert(0, largest)
        smallest = nums[0]

        for i in range(1, len(nums)):
            if smallest < nums[i] and nums[i] < largeNumbers[i]:
                return True
            
            elif nums[i] < smallest:
                    smallest = nums[i]
        return False
    
